import Link from "next/link";

const LandingHeader = () => (
  <div className="landing">
    <h1 className="landing--title">Woo Young Choi</h1>
    <p>I build things for the web.</p>
    <style jsx>
      {`
        .landing {
          color: #00ace6;
          display: block;
          font-family: "Georgia, serif";
        }
        .landing--title {
          font-size: 20px;
          font-weight: normal;
        }
      `}
    </style>
  </div>
);

export default LandingHeader;
